import React from 'react';

const Cell = ({ alive, cntCellDeadCum, onClick }) => {
  // 根据 cntCellDeadCum 的值设置单元格样式
  const cellStyle = {
    backgroundColor: alive ? 'green' : `rgb(${255 - cntCellDeadCum * 10}, ${255 - cntCellDeadCum * 10}, ${255 - cntCellDeadCum * 10})`
  };

  return (
    <div
      className="cell"
      style={cellStyle}
      onClick={onClick}
    ></div>
  );
};

export default Cell;
